import React from "react";

class LikesCounter extends React.Component {
  render() {
    return (
      <>
        <input
          type="button"
          value="DALE LIKE!!"
          onClick={this.props.handleClick}
        />
        <span>{this.props.stateNumber}</span>
        <i className="fas fa-heart"></i>
      </>
    );
  }
}

export default LikesCounter;
